  return (
    <div className="App">
      <Nav />
      <ItemListContainer greeting='BIENVENIDE'/>
      <Header titulo='ME SALIOOOOO' subtitulo='500.000' />
        <p>
          holis
        </p>
    </div>
  );
}

export default App;
